								</style>
							</defs>
							<g id="Management_Philosophy" data-name="Management_Philosophy" transform="translate(-618 -704)">
								<text id="Management_Philosophy" data-name="Management Philosophy" class="cls-1-2" transform="translate(618 778)"><tspan x="0" y="0">Management Philosophy</tspan></text>
								<text id="経営理念" class="cls-2-2" transform="translate(663 760)"><tspan x="0" y="0">経営理念</tspan></text>
							</g>
							</svg>
							</h3>
						<span class="suwarikuAboutPhilosphyConentImgB"></span>
						<p>私たちは、物流業務を通じて、<br>全従業員の物心両面の豊かさを実現すると共に、<br>お客様と社会の発展に貢献します。</p>
					</div>
					<div class="suwarikuAboutPhilosphyContent">
						<h3 class="suwarikuAboutPhilosphyTitle"><svg xmlns="http://www.w3.org/2000/svg" width="255" height="84" viewBox="0 0 255 84">
							<defs>
								<style>
								.cls-1-3 {
									fill: #a7a7a7;
									font-size: 32px;
									font-family: Playball-Regular, Playball;
								}
							
								.cls-2-3 {
									font-size: 50px;
									font-family: TenMincho-Regular, Ten Mincho;
								}
								</style>
							</defs>
							<g id="Behavioral_guidelines" data-name="Behavioral_guidelines" transform="translate(-636 -705)">
								<text id="Behavioral_guidelines" data-name="Behavioral guidelines" class="cls-1-3" transform="translate(637 779)"><tspan x="0" y="0">Behavioral guidelines</tspan></text>
								<text id="行動指針" class="cls-2-3" transform="translate(664 761)"><tspan x="0" y="0">行動指針</tspan></text>
							</g>
							</svg>
							</h3>
						<span class="suwarikuAboutPhilosphyConentImgC"></span>
						<p>私たちは、決められたこと基本的なことを確実に実行します。<br>私たちは、お客様と共にお取引先様と共に社員みんなと<br>共に明るく積極的に前向きに行動します。</p>
					</div>
					<div class="suwarikuAboutPhilosphyContent">
						<h3 class="suwarikuAboutPhilosphyTitle"><svg xmlns="http://www.w3.org/2000/svg" width="350" height="84" viewBox="0 0 350 84">
							<defs>
								<style>
