							</defs>
							<g id="Corporate_philosophy" data-name="Corporate_philosophy" transform="translate(-651 -705)">
								<text id="Corporate_philosophy" data-name="Corporate philosophy" class="cls-1-4" transform="translate(699 779)"><tspan x="0" y="0">Corporate philosophy</tspan></text>
								<text id="社訓_仁義誠和" data-name="社訓・仁義誠和" class="cls-2-4" transform="translate(651 761)"><tspan x="0" y="0">社訓・仁義誠和</tspan></text>
							</g>
							</svg>
							</h3>
						<span class="suwarikuAboutPhilosphyConentImgD"></span>
						<p>【仁】　万事において人の心を尊重した対応をおこなう<br>【義】　道義・原理原則に則った判断を行う<br>【誠】　常に誠実に行動する<br>【和】　共に働く仲間の和をもって事を成す</p>
						<span class="suwarikuAboutPhilosphyConentImgD-2"></span>
