						</div>
						<div class="suwarikuAboutPhilosphyLogoText"><p>諏訪湖というイメージから、純白な白鳥を採用しました。<br>純白の清純なイメージからは、人に対する優しさや愛情を<br>大切にしていきたいとの思いがこめられており、<br>二羽の白鳥が寄り添うように、いとおしさが表現されています。<br>愛と慈悲の心をハート型で表現されています。</p></div>
